"use strict";function setCookie(e,t,o){var n=new Date,i=n.getDate(),r=n.getHours();n.setDate(i+o),n.setHours(r-8),document.cookie=e+"="+encodeURIComponent(t)+";path=/;expires="+n}function removeCookie(e){setCookie(e,"",-1)}function getCookieList(){var e=[],t=document.cookie;return t?e=(e=t.split("; ")).map(function(e){return{name:e.split("=")[0],content:decodeURIComponent(e.split("=")[1])}}):e}function getCookie(t){var e=getCookieList().filter(function(e){return e.name===t})[0];return e?decodeURIComponent(e.content):""}